import React, {useState} from 'react'
import MuseumThumbnails from '../museum-components/MuseumThumbnails'

import allTheData from './ThumbnailsData'

export default function MuseumBody() {

   const [allThumbnails, setAllThumbnails] = useState(allTheData)

    // const museumData=allTheData
    // console.log(museumData)


    return (
        <div className='museum-body'>
            {allThumbnails.map(m =>  
                <MuseumThumbnails title={m.title} introText={m.introText} img={m.images[0]} key={m.id} />
            )}
        </div>
    )
}
